import React, { Component } from 'react';
import Regular from './Regular.js'


class App extends Component {

    FrogMode

    render() {
        return (
            <div className="App">
                <button className="button" onClick={FrogMode}>Frog Mode</button>
                <Regular></Regular>
            </div>
        );
    }
}

export default App;
